import React from "react";
import { MenuList } from "../data/data";
import Layout from "./../components/Layout/Layout";
import {
  Box,
  Card,
  CardActionArea,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";


import { useEffect, useState } from "react";
//import "./App.css";

function Menu() {
  const [data, setData] = useState([]);

  const fetchData = () => {
    fetch(`http://127.0.0.1:8000/`)
      .then((response) => response.json())
      .then((actualData) => {
        console.log(actualData);
        setData(actualData.products);
        console.log(data);
      })
      .catch((err) => {
        console.log(err.message);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="App">
      <tbody>
        <tr>
          <th>Id</th>
          <th>Category</th>

        </tr>
        {data ?.map((item, index) => (
          <tr key={index}>
            <td>{item.id}</td>
            <td>{item.category}</td>


          </tr>

        ))}
      </tbody>
    </div>
  );
}

export default Menu;
